<strong>cl-tree-equal</strong> is an autoloaded compiled Lisp function in `<code>cl-seq.el</code>'.<br/>
<br/>
(cl-tree-equal TREE1 TREE2 [KEYWORD VALUE]...)<br/>
<br/>
Return t if trees TREE1 and TREE2 have `eql' leaves.<br/>
Atoms are compared by `eql'; cons cells are compared recursively.<br/>
<br/>
Keywords supported:  :test :test-not :key
